	.icon-wrapper {
		width: 100%;
		display: flex;
		align-items: inherit;
		justify-content: inherit;
	}

	.icon-svg {
		user-select: none;
		width: 1em;
		height: 1em;
		display: inline-block;
		fill: currentColor;
		flex-shrink: 0;
		font-size: inherit;
	}
`;
